import React from "react"
import './too.css'

const Too =(props) => {
 const {items} = props;
 const ListItems = items.map(item => {
    return (
        <div key={item.id}>
           <span>item.name)</span>
           <span>(item.age)</span>
           <span>&times;</span>         
       </div>
    );
 })
    return(
        <div>
            {ListItems}
        </div>
    )

}

export default Too
